import React from 'react'
function BigSampleImage(props) {
  return (
    <>
        <div className='bigimage'>
            <img className='img' src={props.image}>{props.img}</img>
            <h1>{props.name}</h1>
        </div>
    </>
  )
}

export default BigSampleImage
